package section9.linkedList;

public class ListNode {
	public int val;
	public ListNode next;
	public ListNode() {
		super();
		// TODO Auto-generated constructor stub
	}
	
	public ListNode(int val) {
		super();
		this.val = val;
	}

	public ListNode(int val, ListNode next) {
		super();
		this.val = val;
		this.next = next;
	}
	
}
